import Head from 'next/head'
import Link from 'next/link'

function Layout({ children }) {


    return (
        <div>
            <Head>
                <title>App NextJs</title>  
            </Head>

            <div>{children}</div>
        
        </div>
    )
  }
  
  export default Layout
